import { useActionState } from 'react';

// Increment
async function increment(previousState: number) {
  return previousState + 1;
}

// Decrement
async function decrement(previousState: number) {
  return previousState - 1;
}

// Reset
async function reset(previousState: number) {
  return 0;
}

export function CounterApp() {
  const [state, formAction] = useActionState(increment, 0);

   // インクリメント、デクリメント、リセットボタン
   return (
     <form>
       <div>
         <p>{state}</p>
         {/* インクリメントボタン */}
         <button type="button" formAction={formAction}>
           Increment
         </button>
         {/* デクリメントボタン */}
         <button
           type="button"
           formAction={async (formData) => prevState - 1}
         >
           Decrement
         </button>
         {/* リセットボタン */}
         <button
           type="button"
           formAction={async () => 0}
         >
           Reset
         </button>
       </div>
     </form>
     )
}
